import { combineReducers } from "redux";

function productsApp(state = ["name"], action) {
        // console.log(action.payload);
        
    switch (action.type) {
        case "FETCH_PRODUCTS":
            return [...state,action.payload]
        default:
      return state;
    }
}


export default combineReducers({
    products:productsApp
})
